features.script:
let b1 = parcel.getFeatureById('bone1')
let b2 = parcel.getFeatureById('bone2')
let b3 = parcel.getFeatureById('bone3')


feature.on('click',e=>{

  b1.position.x = 2
  b2.position.y = 1
  b1.position.z = 1

  b2.position.x = 2
  b2.position.y = 1
  b2.position.z = 1

  b3.position.x = 2.15
  b3.position.y = .55
  b3.position.z = 1
})

var url =["http://www.frankenzilla.com/vox/si/space_invader1a.vox","http://www.frankenzilla.com/vox/si/space_invader1b.vox"]
var i = 0
var z_max = 3.5
var z_min = -3.2
var z_incr = .06
var z_cur = 2


let numMilliSecs = 150

function newPos( i ) {

  if (i != url.length) {
    feature.set({url:url[i]}) 

    z_cur = z_cur + z_incr
    if (z_cur > z_max) { 
          z_incr = -.06
          z_cur = z_max   
          }      
    if (z_cur < z_min) { 
          z_incr = .06
          z_cur = z_min
          }   

    feature.position.z = z_cur

    i++ 
    setTimeout( ()=>{ newPos( i ) }, numMilliSecs ) 
    }

  else {
    i = 0
    setTimeout( ()=>{ newPos( i ) }, numMilliSecs )
    }
}


  newPos( i )
